import React from "react";
import 'materialize-css';
import "./App.css";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

import Home from "./pages/Home";

function App() {
    return (
            <div>
            <Router>
						<Switch>
							<Route exact path="/" component={Home} />
               </Switch>
					</Router>
            </div>

        );
}

export default App;
